    const location = useLocation();
    return (
        <div>
            {location.pathname !== '/' && (
        <nav>
          <Link to="/">Home</Link>
        </nav>
      )}
            <form>
                <label>Email</label>
                <input name='email' type="text"></input>
                <label>Password</label>
                <input name="password" type="password"></input>
                <button>Submit</button>
            </form>
        </div>
    )
};

export default Form;
